import React from 'react'
import { faReact } from "@fortawesome/free-brands-svg-icons";
import { faDatabase } from "@fortawesome/free-solid-svg-icons";
import { faJs } from "@fortawesome/free-brands-svg-icons";
import { faNpm } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import '../App.css';

export default function Projects() {
    return (
        <div>
            <section id = "Projects">
            <div class = "skillIcon">
                <div className="row-center"><FontAwesomeIcon spin="true" color="black" size="5x" icon = {faReact}/>
                <FontAwesomeIcon color="black" size="5x" icon = {faDatabase}/>
                <FontAwesomeIcon color="black" size="5x" icon = {faJs}/></div>
                <div className="row-center"><FontAwesomeIcon color="black" size="5x" icon = {faNpm}/>
                <div className="Cicon">C#</div></div>
            </div>
                <p>Projects</p>
                <p>Projects</p>
                <p>Projects</p>
                <p>Projects</p>
                <p>Projects</p>
            </section>
        </div>
    )
}
